import React from 'react'
import Slider from 'react-slick';
import Slide from "react-slick"

function Subheader() {
    const settings = {
        dots: true,
        pauseOnFocus:true,
        infinite: true,
        arrows:false,
        speed: 400,
        slidesToShow: 10,
        autoplay:true,
        slidesToScroll: 1
      };
    
    const companys = [
        {
            name:"LC WAİKİKİ",
            img:"ssss"
        },
        {
            name:"KİNETİX",
            img:"aaaaa"
        }
    ]
    return (
        <div className="container justify-between mx-auto w-full flex mt-20 items-center "> 
           <Slide>{companys.map((data)=>{
                return(<p className="text-black">{data.name}</p>)
            })}</Slide> 
        </div>
    )
}

export default Subheader
